import React from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';

function AnnouncementHeader({ onHowToClick }) {
  // TODO: Fetch header from backend
  const [header, setHeader] = React.useState('Order by the end of the month!');

  return (
    <Box sx={{ bgcolor: '#f5f5f5', py: 2, px: 2, display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
      <Typography variant="h6">{header}</Typography>
      <Button variant="outlined" onClick={onHowToClick}>
        How to use the app
      </Button>
    </Box>
  );
}

export default AnnouncementHeader;
